import React from 'react';
import styled from 'styled-components';

const ProjectsSection = styled.section`
  padding: 4rem 0;
  background-color: var(--bg-color);
`;

const ProjectsContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const SectionTitle = styled.h2`
  font-size: 2rem;
  color: var(--text-primary);
  margin-bottom: 3rem;
  text-align: center;
`;

const ProjectGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(350px, 1fr));
  gap: 2rem;
`;

const ProjectCard = styled.div`
  background: white;
  border-radius: 12px;
  overflow: hidden;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  transition: transform 0.2s ease;

  &:hover {
    transform: translateY(-5px);
  }
`;

const ProjectImage = styled.div`
  width: 100%;
  height: 200px;
  overflow: hidden;

  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
    transition: transform 0.3s ease;
  }

  &:hover img {
    transform: scale(1.05);
  }
`;

const ProjectInfo = styled.div`
  padding: 1.5rem;
`;

const ProjectTitle = styled.h3`
  font-size: 1.25rem;
  color: var(--text-primary);
  margin-bottom: 0.5rem;
`;

const ProjectDescription = styled.p`
  color: var(--text-secondary);
  font-size: 0.9rem;
  margin-bottom: 1rem;
  line-height: 1.6;
`;

const TagContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 0.5rem;
  margin-bottom: 1rem;
`;

const Tag = styled.span`
  background: ${props => props.color || '#e0e0e0'};
  color: ${props => props.textColor || '#333'};
  padding: 0.25rem 0.75rem;
  border-radius: 15px;
  font-size: 0.8rem;
  font-weight: 500;
`;

const ProjectLinks = styled.div`
  display: flex;
  gap: 1rem;
  margin-top: 1rem;
`;

const ProjectLink = styled.a`
  color: var(--accent);
  text-decoration: none;
  font-size: 0.9rem;
  display: flex;
  align-items: center;
  gap: 0.5rem;

  &:hover {
    text-decoration: underline;
  }
`;

const Projects = () => {
  const projects = [
    {
      title: "AI Image Generator",
      description: "A deep learning application that generates unique images from text descriptions using state-of-the-art AI models.",
      image: "/project1.jpg",
      github: "https://github.com/username/ai-image-generator",
      demo: "https://ai-image-generator.demo",
      tags: [
        { name: "Python", color: "#3776AB", textColor: "#fff" },
        { name: "TensorFlow", color: "#FF6F00", textColor: "#fff" },
        { name: "React", color: "#61DAFB", textColor: "#000" }
      ]
    },
    {
      title: "E-commerce Platform",
      description: "Full-stack e-commerce solution with real-time inventory management and payment processing.",
      image: "/project2.jpg",
      github: "https://github.com/username/ecommerce",
      demo: "https://ecommerce.demo",
      tags: [
        { name: "Node.js", color: "#339933", textColor: "#fff" },
        { name: "MongoDB", color: "#47A248", textColor: "#fff" },
        { name: "Express", color: "#000000", textColor: "#fff" }
      ]
    },
    {
      title: "Social Media Analytics",
      description: "Data analytics platform that provides insights from social media engagement and user behavior.",
      image: "/project3.jpg",
      github: "https://github.com/username/social-analytics",
      demo: "https://social-analytics.demo",
      tags: [
        { name: "Python", color: "#3776AB", textColor: "#fff" },
        { name: "Django", color: "#092E20", textColor: "#fff" },
        { name: "PostgreSQL", color: "#336791", textColor: "#fff" }
      ]
    },
    {
      title: "Real-time Chat App",
      description: "Instant messaging application with real-time updates and file sharing capabilities.",
      image: "/project4.jpg",
      github: "https://github.com/username/chat-app",
      demo: "https://chat-app.demo",
      tags: [
        { name: "React", color: "#61DAFB", textColor: "#000" },
        { name: "Socket.io", color: "#010101", textColor: "#fff" },
        { name: "Firebase", color: "#FFCA28", textColor: "#000" }
      ]
    },
    {
      title: "Portfolio Generator",
      description: "Automated portfolio website generator that creates personalized portfolios from user data.",
      image: "/project5.jpg",
      github: "https://github.com/username/portfolio-gen",
      demo: "https://portfolio-gen.demo",
      tags: [
        { name: "Vue.js", color: "#4FC08D", textColor: "#fff" },
        { name: "TypeScript", color: "#3178C6", textColor: "#fff" },
        { name: "Tailwind", color: "#06B6D4", textColor: "#fff" }
      ]
    },
    {
      title: "Task Management System",
      description: "Collaborative task management platform with real-time updates and team collaboration features.",
      image: "/project6.jpg",
      github: "https://github.com/username/task-manager",
      demo: "https://task-manager.demo",
      tags: [
        { name: "Next.js", color: "#000000", textColor: "#fff" },
        { name: "GraphQL", color: "#E10098", textColor: "#fff" },
        { name: "Prisma", color: "#2D3748", textColor: "#fff" }
      ]
    }
  ];

  return (
    <ProjectsSection>
      <ProjectsContainer>
        <SectionTitle>Projects</SectionTitle>
        <ProjectGrid>
          {projects.map((project, index) => (
            <ProjectCard key={index}>
              <ProjectImage>
                <img src={project.image} alt={project.title} />
              </ProjectImage>
              <ProjectInfo>
                <ProjectTitle>{project.title}</ProjectTitle>
                <TagContainer>
                  {project.tags.map((tag, tagIndex) => (
                    <Tag key={tagIndex} color={tag.color} textColor={tag.textColor}>
                      {tag.name}
                    </Tag>
                  ))}
                </TagContainer>
                <ProjectDescription>{project.description}</ProjectDescription>
                <ProjectLinks>
                  <ProjectLink href={project.github} target="_blank" rel="noopener noreferrer">
                    GitHub
                  </ProjectLink>
                  <ProjectLink href={project.demo} target="_blank" rel="noopener noreferrer">
                    Live Demo
                  </ProjectLink>
                </ProjectLinks>
              </ProjectInfo>
            </ProjectCard>
          ))}
        </ProjectGrid>
      </ProjectsContainer>
    </ProjectsSection>
  );
};

export default Projects;
